import React from 'react'

function DeviceStatus() {
  return (
    <div>
        <div className="flex items-center justify-between mb-3">
            <span>สถานะอุปกรณ์ (Device Status)</span>
        </div>
    </div>
  )
}

export default DeviceStatus
